import React from "react";
import "../Branches/branches.css";
import image from "../../images/academics.jpg";

function Branches(){
    return(
        <>
        <div className="branches-headimage">
            <img src={image} alt="blog" width="100%" height="100%"/>
        </div>
        </>
    )
}
export default Branches;
